IN vec4 vNormal;
IN vec4 vColor;
IN vec4 vTangent;
IN vec4 vCotangent;
IN vec4 vPosition;
IN vec3 cameye;
OUT vec4 FragColor;

uniform vec4 mat_specular;
uniform float mat_hardness;
IN vec4 vTexCoord0;
IN vec4 vTexCoord1;
IN vec4 vTexCoord2;
IN vec4 vTexCoord3;
IN vec4 vTexCoord4;
IN vec4 vTexCoord5;
IN vec4 vTexCoord6;
IN vec4 vTexCoord7;
void main(){
vec4 Normal = vec4( 0, 0, 1, 1 );
vec4 Color = vec4( 1 );
vec4 Specular = mat_specular;
Normal = CalcBumpedNormal( vNormal, vTangent, vCotangent, Normal);
Normal = normalize( view * vec4( Normal.xyz, 0 ));
  vec3 shadow = vec3( 1 );
  vec3 spec = vec3( 0 );
FragColor = vec4( Color.rgb * vColor.rgb * shadow.rgb + spec.rgb * Specular.rgb, Color.a * vColor.a ); //(Normal.xyz + 1 )/2
#if (__VERSION__ < 130)
gl_FragColor = FragColor;
#endif
}
